import { Component, OnInit } from '@angular/core';
import { DataServiceService } from '../data-service.service';
import { Router } from '@angular/router';
import { zip } from 'rxjs';

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.scss']
})
export class SignupComponent implements OnInit {

constructor(private service: DataServiceService,
            private route: Router){ }

  ngOnInit(): void {}

  orgName: string = '';
  contact: any;
  email: string = '';
  streetAddress: string = '';
  city: string = '';
  district: string = '';
  block: string = '';
  zipCode: string = '';
  state: string = '';
  password: string = '';
  confirmPassword: string = '';


  onSubmit() { 
    if(this.orgName && this.streetAddress &&  this.city && this.district && this.zipCode && this.state && this.contact && this.password && this.confirmPassword){

    const data = {
      organisation : this.orgName,
      streetAddress: this.streetAddress,
      city: this.city,
      district: this.district,
      block: this.block,
      zipCode: this.zipCode,
      state: this.state,
      email: this.email,
      contact: this.contact,
      password: this.password,
      confirmPassword: this.confirmPassword,
    }

     this.service.signUp(data).subscribe((response: any) => {
        console.log('Form submitted successfully', response);
        this.route.navigate(['/'])
      }, (error: any) => {
        console.error('Error submitting form', error);
      });
    }
  }




}
